  "title": {
    "nb": "Generelle marine biotoper"
  },
  "description": {
    "nb": "Metadata beskriver et sett av data med generelle biotoper i norske havområder. Biotoper er områder med særegne bunndyrsamfunn og likt fysisk miljø. Hver biotop har oftest en unik sammensetning av arter. Hvilke arter dette er, bestemmes av miljøforholdene i området. Biotopklassifikasjonen i disse datasett er basert på video- og miljøvariabelanalyse. Miljøvariablene som går i de generelle biotop-modellene er dyp, terreng, bunnsedimenter, vanntemperatur, saltholdighet og strøm nær bunnen fra oseanografiske modeller. Fire områder er hittil blitt kartlagt og modellert hver for seg: Barentshavet (MAREANO-kartlagte områder), TromsIII/NordlandVII, NordlandVI og Midtnorsk sokkel. Målet er å harmonisere disse datasettene og lage en helhetlig biotopkart for norske havområder."
  },
