  "title": {
    "nb": "Nasjonal database for grunnundersøkelser (NADAG)"
  },
  "description": {
    "nb": "NGU har utviklet Nasjonal database for grunnundersøkelser (NADAG) med tilhørende karttjenester og muligheter for å laste opp data, i første omgang for geotekniske undersøkelser. Prosjektet for utvikling av NADAG er et samarbeid mellom NGU og etatene Statens vegvesen, Bane NOR, og Norges vassdrags- og energidirektorat, og konsulentene Norkart, Trimble og CGI. Punktene i kartet representerer geotekniske borehull (GB), hvor metadata vises (f.eks. boretype, oppdragsfirma, oppdragsgiver, stedfestelse (posisjon), boret dybde (evt. dyp til fjell), rapportnr.). For noen punkter vil mer informasjon være tilgjengelig (f.eks. lenke til rapport og evt. til rådata, boreprofil og måleresultater). NADAG-modellen er basert på en datastruktur beskrevet i SOSI-standardene for Geovitenskapelige undersøkelser og Geotekniske undersøkelser. NADAG er innlemmet på listen over datasett til DOK.\n\nVisningstjenesten til NADAG har to innsynsløsninger. Mobil versjon ligner de andre kartinnsynene til NGU. I menyen på høyre side kan man klikke på «Gå til NADAG fullversjon» (man beholder da kartutsnittet). NADAG er landsdekkende, og vil gradvis fylles med mer data etter som dataeiere leverer sine data. Man kan levere data til NADAG på to måter: gjennom verktøyet GeoSuite toolbox (fullstendige datasett, foretrukket måte), eller gjennom NADAG WebReg (i hovedsak metadata og pdf-rapporter). Alle data som ligger i NADAG er fritt tilgjengelig for alle, og lastes ned vederlagsfritt. Det vil være varierende mengde informasjon tilhørende hvert datapunkt, noe som vil avhenge blant annet av formatet data er overlevert på, og dataeiers vilje til å offentliggjøre data utover kun å vise metadata. Tilgjengelige rapporter (pdf) kan lastes ned fra NADAGs infoark. For øvrig kan data lastes ned på GeoSuite-format. Det arbeides med nedlastingsløsning for andre format (f.eks. SOSI, shape, GML, m.m.). I tillegg kan man benytte NADAGs WMS. \n\nNADAG og bidragsytere er ikke ansvarlige for den enkeltes bruk av datasettene. Datasettene og rapportene ble laget for bestemte formål/prosjekt. Den som benytter data for nye formål/prosjekt må gjøre egne og selvstendige vurderinger av dataenes kvalitet, egnethet og gyldighet. Ved bruk av data skal det refereres til rapport/dataeier. Datasettet er gjort tilgjengelig under Norsk lisens for offentlige data (NLOD). Ved å starte NADAG nettjeneste godtar du disse vilkårene for bruk."
  },
