  "title": {
    "nb": "Løsmasser"
  },
  "description": {
    "nb": "Løsmassedataene viser hovedsaklig utbredelsen av løsmassetyper som dekker fjelloverflaten. Det meste av løsmassene ble dannet under og etter siste istid. Dataene viser kun hvilken jordart som dominerer i de øverste meterne av terrengoverflaten. Tykke og tynne lag av andre jordarter kan opptre lengre ned i jordprofilet. Datagrunnlaget for tema jordarter er basert på innholdet i kvartærgeologiske kart (løsmassekart), som foreligger analogt i flere målestokker (hovedsaklig M 1:250.000, 1:50.000 og 1:20.000). Datasettet er landsdekkende og representerer de beste løsmasseregistreringene i databasen. Kartene er konvertert til digital form ved hjelp av skanning og vektorisering. Temakoder og egenskaper følger i hovedsak SOSI-standarden. I egenskapstabellen til kartet er det gitt opplysninger om jordartstype, og med utgangspunkt i jordartenes egenskaper er det utviklet avledede tema. Dette kan være infiltrasjonsegenkaper og grunnvannspotensiale. Forholdene ligger også til rette for senere å utvikle tema av interesse for avfallsdeponering, grunnforhold og telefare. De avleda temaene må ikke oppfattes som absolutte, men er kun retningsgivende. Lokale forhold og variasjoner vil kunne medvirke til at avledningen burde være annerledes enn oppgitt. Lokale undersøkelser anbefales derfor før tiltak basert på avledningen settes i verk."
  },
