  "description": {
    "nb": "Marin grense angir det høyeste nivået som havet nådde etter siste istid. Marin grense angir dermed det høyest mulige nivået for marine sedimenter (hav- og fjordavsetninger) som er hevet til tørt land. Dataene består av punktregistreringer, linjer samt polygoner. Linjer og polygoner er modellert fra punktene og en 10 m høydemodell. Datasettet er landsdekkende."
  },
