  "title": {
    "nb": "Mineralressurser - areal og verdivurdering"
  },
  "description": {
    "nb": "Dataene gir en oversikt over registrerte oppføringer av industrimineral, naturstein og metallressurser. \nMineralressursdataene inneholder både areal- og punktoppføringer for alle tre grupper der den gamle leveransen (\"Mineralressurser\") manglet arealer for metaller. Datasettet \"Mineralressurser - areal og verdivurdering\" vil erstatte den gamle leveransen og gir en oversikt over dokumenterte forekomster (verdivurderte arealer; forekomst/deposit), prospektive områder (arealer med høy sannsynlighet for funn av økonomisk interessante mineraler; prospekt/prospect), registreringer hvor det er observert og/eller analysert forhøyede verdier av økonomisk interessante mineraler (registrering/occurence) og provinser (arealer med muligheter for funn av gitte mineraler; provins/province). Registreringene kan inneholde lite eller mye informasjon. \nDe dokumenterte forekomstene inneholder en vurdering av offentlig betydning; internasjonal, nasjonal, regional, lokal, liten eller ingen eller ikke vurdert.\nDataene er innsamlet over lang tid og oppdateres fortløpende etter prioriteringer."
  },
